import React from 'react';
import 'tachyons';

const Navigation = ( {onRouteChange, isSignedin}) => {
	if( isSignedin === true) {
		return(
			<nav>
				<div onClick={() => onRouteChange('signin')} className="f3 pa3 dim blacklink underline pointer" style={{display:'flex' ,justifyContent:'flex-end'}} > 
				   {'Signout'}
				</div>
			</nav>
		)
	}
	else {
		return(
			<nav>
				<div onClick={() => onRouteChange('signin')} className="f3 pa3 dim blacklink underline pointer" style={{display:'flex' ,justifyContent:'flex-end'}} > 
				   {'Signin'}
				</div>
				<div onClick={() => onRouteChange('register')} className="f3 pa3 dim blacklink underline pointer" style={{display:'flex' ,justifyContent:'flex-end'}} > 
				   {'Register'}
				</div>
			</nav>
		)
	}

}

export default Navigation;
